,"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"uint256","name":"","type":"uint256"}],"name":"_studyAges","outputs":[{"internalType":"string","name":"","type":"string"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"uint256","name":"","type":"uint256"}],"name":"_studyAudienceMap","outputs":[{"internalType":"string","name":"","type":"string"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"uint256","name":"","type":"uint256"}],"name":"_studyMap","outputs":[{"internalType":"uint256","name":"study_id","type":"uint256"},{"internalType":"uint256","name":"user_id","type":"uint256"},{"internalType":"string","name":"image","type":"string"},{"internalType":"string","name":"title","type":"string"},{"internalType":"string","name":"description","type":"string"},{"internalType":"string","name":"permission","type":"string"},{"internalType":"uint256","name":"contributors","type":"uint256"},{"internalType":"uint256","name":"audience","type":"uint256"},{"internalType":"uint256","name":"budget","type":"uint256"},{"internalType":"string","name":"reward_type","type":"string"},{"internalType":"uint256","name":"reward_price","type":"uint256"},{"internalType":"uint256","name":"total_spending_limit","type":"uint256"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"uint256","name":"","type":"uint256"}],"name":"_studyTitles","outputs":[{"internalType":"string","name":"","type":"string"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"uint256","name":"","type":"uint256"}],"name":"_surveyMap","outputs":[{"internalType":"uint256","name":"survey_id","type":"uint256"},{"internalType":"uint256","name":"study_id","type":"uint256"},{"internalType":"uint256","name":"user_id","type":"uint256"},{"internalType":"string","name":"name","type":"string"},{"internalType":"string","name":"description","type":"string"},{"internalType":"string","name":"date","type":"string"},{"internalType":"string","name":"image","type":"string"},{"internalType":"uint256","name":"reward","type":"uint256"},{"internalType":"uint256","name":"submission","type":"uint256"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"uint256","name":"user_id","type":"uint256"}],"name":"getAllCompletedSurveysIDByUser","outputs":[{"internalType":"uint256[]","name":"","type":"uint256[]"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"uint256","name":"study_id","type":"uint256"}],"name":"getAllSurveysIDByStudy","outputs":[{"internalType":"uint256[]","name":"","type":"uint256[]"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"uint256","name":"user_id","type":"uint256"},{"internalType":"uint256","name":"study_id","type":"uint256"}],"name":"getCompletedInformedConsentId","outputs":[{"internalType":"string","name":"","type":"string"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"uint256","name":"user_id","type":"uint256"}],"name":"getUserDetails","outputs":[{"internalType":"string","name":"","type":"string"},{"internalType":"uint256","name":"","type":"uint256"},{"internalType":"string","name":"","type":"string"},{"internalType":"string","name":"","type":"string"},{"internalType":"string","name":"","type":"string"},{"internalType":"string","name":"","type":"string"},{"internalType":"uint256","name":"","type":"uint256"}],"stateMutability":"view","type":"function"}],"devdoc":{"kind":"dev","methods":{},"version":1},"userdoc":{"kind":"user","methods":{"_categoryMap(uint256)":{"notice":"The map of all the Survey Category ."},"_completedinformedMap(uint256)":{"notice":"The map of all the Completed Informed Consent."},"_completedsurveyMap(uint256)":{"notice":"The map of all the Completed Surveys."},"_fhirMap(uint256)":{"notice":"The map of all the FHIR information."},"_ongoingMap(uint256)":{"notice":"The map of all the OnGoing Studies."},"_questionanswerdMap(uint256)":{"notice":"The map of all th